    value: The Mason Tenders' District Council of Greater New York and Long Island
      (also referred to as the Mason Tenders District Council of Greater New York;
      and the Mason Tenders District Council); the Mason Tenders District Council
      Trust Funds; the Mason Tenders Trust Funds; the Mason Tenders D.C. Trust Funds;
      and the Mason Tenders Welfare Fund are not non-federal accounts of our committee.
      The Mason Tenders' District Council of Greater New York and Long Island is an
      umbrella organization representing locals of the Laborers' International Union
      of North America in the New York metropolitan area. The Mason Tenders District
      Council Trust Funds; the Mason Tenders Trust Funds; the Mason Tenders D.C. Trust
      Funds; and the Mason Tenders Welfare Fund are ERISA trust funds that handle
      the Mason Tenders' District Council PAC employee's health and pension benefits.
      In addition
  - name: AMENDED CD
    number: '5'
    value: ' these trust funds also act as our collecting agent. Further'
  - value: ' the Mason Tenders'' District Council PAC leases office space from the
      trust funds. Disclosed payments include rent and ancillary services such as
      trash pick-up'
  - value: ' utilities'
  - value: ' etc. All contributions were $.05 or $.10 contributions from individual
      union members. None of these contributors reached the aggregate $200 reporting
      limit.'
  expected_count: 5
  input: TEXT,F3XA,,"The Mason Tenders' District Council of Greater New York and Long
    Island (also referred to as the Mason Tenders District Council of Greater New
    York; and the Mason Tenders District Council); the Mason Tenders District Council
    Trust Funds; the Mason Tenders Trust Funds; the Mason Tenders D.C. Trust Funds;
    and the Mason Tenders Welfare Fund are not non-federal accounts of our committee.
    The Mason Tenders' District Council of Greater New York and Long Island is an
    umbrella organization representing locals of the Laborers' International Union
    of North America in the New York metropolitan area. The Mason Tenders District
    Council Trust Funds; the Mason Tenders Trust Funds; the Mason Tenders D.C. Trust
    Funds; and the Mason Tenders Welfare Fund are ERISA trust funds that handle the
    Mason Tenders' District Council PAC employee's health and pension benefits. In
    addition, these trust funds also act as our collecting agent. Further, the Mason
    Tenders' District Council PAC leases office space from the trust funds. Disclosed
    payments include rent and ancillary services such as trash pick-up, utilities,
    etc. All contributions were $.05 or $.10 contributions from individual union members.
    None of these contributors reached the aggregate $200 reporting limit."
